import os
import sys

def PatternMatching(Pattern, Genome):
    Positions = []
    for i in range (len(Genome) - len(Pattern) + 1):
        sub = Genome[i:len(Pattern)+i]
        if Pattern == sub:
            Positions.append(i)
        
    return ' '.join(str(num) for num in Positions)
def main():
    Pattern = "CTTGATCAT"
    Genome = ""
    Results = PatternMatching(Pattern, Genome)
    print(Results)
    
main() 